      out.write("        var filteredItemsProducts = [];\n");
      out.write("        var allItemsProducts = [];\n");
      out.write("        \n");
      out.write("        // Hàm khởi tạo phân trang cho products\n");
      out.write("        function initializePaginationProducts() {\n");
      out.write("            // Lấy tất cả dữ liệu từ bảng\n");
      out.write("            var table = document.getElementById('productsTable');\n");
      out.write("            var rows = table.getElementsByTagName('tbody')[0].getElementsByTagName('tr');\n");
      out.write("            \n");
      out.write("            // Lưu tất cả dữ liệu\n");
      out.write("            allItemsProducts = [];\n");
      out.write("            for (var i = 0; i < rows.length; i++) {\n");
      out.write("                allItemsProducts.push(rows[i].cloneNode(true));\n");
      out.write("            }\n");
      out.write("            \n");
      out.write("            totalItemsProducts = allItemsProducts.length;\n");
      out.write("            filteredItemsProducts = allItemsProducts.slice(); // Copy tất cả items\n");
      out.write("            updatePaginationProducts();\n");
      out.write("        }\n");
      out.write("        \n");
      out.write("        // Hàm cập nhật phân trang cho products\n");
      out.write("        function updatePaginationProducts() {\n");
      out.write("            var totalPages = Math.ceil(filteredItemsProducts.length / itemsPerPageProducts);\n");
      out.write("            var startIndex = (currentPageProducts - 1) * itemsPerPageProducts;\n");
      out.write("            var endIndex = Math.min(startIndex + itemsPerPageProducts, filteredItemsProducts.length);\n");
      out.write("            \n");
      out.write("            // Cập nhật thông tin hiển thị\n");
      out.write("            document.getElementById('showingStart').textContent = filteredItemsProducts.length > 0 ? startIndex + 1 : 0;\n");
      out.write("            document.getElementById('showingEnd').textContent = endIndex;\n");
      out.write("            document.getElementById('totalRecords').textContent = filteredItemsProducts.length;\n");
      out.write("            \n");
      out.write("            updateTableProducts();\n");
      out.write("            \n");
      out.write("            // Cập nhật nút phân trang\n");
      out.write("            updatePaginationButtonsProducts(totalPages);\n");
      out.write("        }\n");
      out.write("        \n");
      out.write("        // Hàm cập nhật bảng products\n");
      out.write("        function updateTableProducts() {\n");
      out.write("            var table = document.getElementById('productsTable');\n");
      out.write("            var tbody = table.getElementsByTagName('tbody')[0];\n");
      out.write("            \n");
      out.write("            // Xóa tất cả hàng hiện tại\n");
      out.write("            tbody.innerHTML = '';\n");
      out.write("            \n");
      out.write("            // Thêm hàng cho trang hiện tại\n");
      out.write("            var startIndex = (currentPageProducts - 1) * itemsPerPageProducts;\n");
      out.write("            var endIndex = Math.min(startIndex + itemsPerPageProducts, filteredItemsProducts.length);\n");
      out.write("            \n");
      out.write("            for (var i = startIndex; i < endIndex; i++) {\n");
      out.write("                tbody.appendChild(filteredItemsProducts[i].cloneNode(true));\n");
      out.write("            }\n");
      out.write("        }\n");
      out.write("        \n");
      out.write("        // Hàm cập nhật nút phân trang cho products\n");
      out.write("        function updatePaginationButtonsProducts(totalPages) {\n");
      out.write("            var pagination = document.getElementById('pagination');\n");
      out.write("            var prevBtn = document.getElementById('prevBtn');\n");
      out.write("            var nextBtn = document.getElementById('nextBtn');\n");
      out.write("            \n");
      out.write("            // Cập nhật nút Previous\n");
      out.write("            if (currentPageProducts <= 1) {\n");
      out.write("                prevBtn.parentElement.classList.add('disabled');\n");
      out.write("            } else {\n");
      out.write("                prevBtn.parentElement.classList.remove('disabled');\n");
      out.write("            }\n");
      out.write("            \n");
      out.write("            // Cập nhật nút Next\n");
      out.write("            if (currentPageProducts >= totalPages) {\n");
      out.write("                nextBtn.parentElement.classList.add('disabled');\n");
      out.write("            } else {\n");
      out.write("                nextBtn.parentElement.classList.remove('disabled');\n");
      out.write("            }\n");
      out.write("            \n");
      out.write("            // Xóa các nút số trang cũ (giữ lại Previous và Next)\n");
      out.write("            var pageButtons = pagination.querySelectorAll('.page-link');\n");
      out.write("            pageButtons.forEach(function(btn) {\n");
      out.write("                if (btn.id !== 'prevBtn' && btn.id !== 'nextBtn') {\n");
      out.write("                    btn.parentElement.remove();\n");
