      out.write("            });\n");
      out.write("            \n");
      out.write("            // Tạo nút số trang mới\n");
      out.write("            var maxVisiblePages = 5;\n");
      out.write("            var startPage = Math.max(1, currentPageProducts - Math.floor(maxVisiblePages / 2));\n");
      out.write("            var endPage = Math.min(totalPages, startPage + maxVisiblePages - 1);\n");
      out.write("            \n");
      out.write("            if (endPage - startPage + 1 < maxVisiblePages) {\n");
      out.write("                startPage = Math.max(1, endPage - maxVisiblePages + 1);\n");
      out.write("            }\n");
      out.write("            \n");
      out.write("            // Thêm nút số trang\n");
      out.write("            for (var i = startPage; i <= endPage; i++) {\n");
      out.write("                var li = document.createElement('li');\n");
      out.write("                li.className = 'paginate_button';\n");
      out.write("                if (i === currentPageProducts) {\n");
      out.write("                    li.classList.add('active');\n");
      out.write("                }\n");
